import React from 'react'

import {GetAllProject} from '../HuddleComponents/GetAllProjects.js';
import {GetAllTickets} from '../HuddleComponents/GetAllTicketFromApi.js';
import {NewTicktForm} from '../HuddleComponents/GetNewTicketForm.js';
import {GetAllMemberDevelopers} from '../HuddleComponents/GetAllMemberDevelopers.js';
export default function LeftNav() {
    let outerDivCss = {
        display: "flex",
        position: "relative",
        height: "600px",
        overflowY: "scroll",
        width: "100"
    }
    let leftNavPartCss = {
        borderRight: "4px solid green",
        position: "sticky",
        flex: "1 0 15%",
        top: "0",
        display: "flex",
        alignItems: "center",
        height: "100%"
    }
    let leftNavButtonsCss = {
        marginTop: "50px",
        marginRight : "5px"
    }
    let letRightDivCss = {
        position: "relative",
        height: "100%",
        right: "0",
        flex: "1 0 85%",
    }
    return (
        <div style={outerDivCss} className="d-flex align-items-start">

            <div class="list-group">
                <a href="v-pills-home" class="list-group-item list-group-item-action active">
                    The current link item
                </a>
                <a href="v-pills-profile" class="list-group-item list-group-item-action">A second link item</a>
                <a href="#" class="list-group-item list-group-item-action">A third link item</a>
                <a href="v-pills-settings" class="list-group-item list-group-item-action">A fourth link item</a>
                </div>
            <div style={letRightDivCss} className="tab-content" id="v-pills-tabContent">
                <div className="tab-pane fade show active" id="v-pills-home" role="tabpanel" aria-labelledby="v-pills-home-tab"><GetAllTickets/></div>
                <div className="tab-pane fade" id="v-pills-profile" role="tabpanel" aria-labelledby="v-pills-profile-tab"><NewTicktForm/></div>
                <div className="tab-pane fade" id="v-pills-messages" role="tabpanel" aria-labelledby="v-pills-messages-tab"><GetAllMemberDevelopers/></div>
                <div className="tab-pane fade" id="v-pills-settings" role="tabpanel" aria-labelledby="v-pills-settings-tab"><GetAllProject/></div>
            </div>
        </div>
    )
}
